  <title>Our Memories</title>
  <style>
        body {
      font-family: Arial, sans-serif;
      background-color: white;
      color: #333;
      margin: 0;
      padding: 0;
    }



    .container {
      padding: 2rem 5%;
    }

 

    .grid {
      columns: 15rem 3;
      gap: 1.4rem;
    }

 

    .grid img {
      width: 30%;
      height: auto;
      margin-bottom: 1rem;
      border-radius: 0.7rem;
    }

    .container .grid img:hover{
      transform: scale(1.1);
      transition: transform 0.5s;

    }

    button {
            border: none;
            padding: 0;
            background: transparent;
            outline: none;
    }

    .modal {
      position: fixed;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      background-color: rgba(0, 0, 0, 0.5);
      display: flex;
      align-items: center;
      justify-content: center;
    }

    .modal-content {
      background-color: white;
      padding: 20px;
      border-radius: 8px;
      position: relative;
    }

    .close-btn {
      position: absolute;
      top: 10px;
      right: 10px;
      font-size: 1.5rem;
      color: #888;
      cursor: pointer;
    }

    .modal-image {
      width: 100%;
    }
    .home-btn {
      position: fixed;
      top: 20px;
      right: 20px;
      padding: 10px 20px;
      background-color: #ff00ea;
      color: white;
      border: none;
      border-radius: 5px;
      cursor: pointer;
    }
    </style
</head>
